import React from 'react';
import KategoriSayfasi from '../../components/kategori/KategoriSayfasi';

const IlkOkulKitaplari = () => {
  return (
    <KategoriSayfasi
      kategoriAdi="İlk Okul Kitapları"
      aciklama="İlkokul öğrencileri için ders kitapları, yardımcı kaynaklar ve aktivite kitapları."
    />
  );
};

export default IlkOkulKitaplari;
